	state = {
		todos: [this.initTodo],
		todo: this.initTodo,
	};

	render() {
		return (
			<div className='App'>
				<div className='title'>
					Todo <strong>list</strong>
				</div>
				<div className='todo-list'>
					<Form />
					<List />
				</div>
			</div>
		);
	}
}

export default App;
